import React, { useState, useEffect, useCallback } from 'react';
import {
  Container,
  Row,
  Col,
  Tab,
  Tabs,
  Button,
  Card,
  Form,
  Alert,
  Badge,
  Modal,
  Table,
  ProgressBar,
} from 'react-bootstrap';
import { toast } from 'react-toastify';
import DatePicker from 'react-datepicker';
import 'react-datepicker/dist/react-datepicker.css';
import { PlusCircle, PersonPlus, CameraVideo, Pencil, Trash, CalendarCheck, CalendarPlus } from 'react-bootstrap-icons';

import studentService from '../../services/studentService';
import slotService from '../../services/slotService';
import interviewService from '../../services/interviewService';

/* Helper: Floating Label Input Component */
const FloatingInput = React.memo(
  ({ label, type, name, value, onChange, placeholder, required, ...rest }) => (
    <Form.Floating className="mb-3">
      <Form.Control
        type={type}
        name={name}
        value={value}
        onChange={onChange}
        placeholder={placeholder || label}
        required={required}
        {...rest}
      />
      <Form.Label>{label}</Form.Label>
    </Form.Floating>
  )
);

/* Student Form */
const StudentForm = React.memo(({ onStudentAdded }) => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    resumeLink: '',
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = useCallback((e) => {
    setFormData((fd) => ({ ...fd, [e.target.name]: e.target.value }));
    setError('');
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    try {
      await studentService.addStudent(formData);
      setFormData({ name: '', email: '', phone: '', resumeLink: '' });
      onStudentAdded();
      toast.success('Student added successfully');
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to add student');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Card className="shadow-sm rounded">
      <Card.Header className="bg-primary text-white d-flex align-items-center">
        <PersonPlus size={24} className="me-2" />
        <h5 className="mb-0">Add New Student</h5>
      </Card.Header>
      <Card.Body>
        {error && (
          <Alert variant="danger" onClose={() => setError('')} dismissible>
            {error}
          </Alert>
        )}
        <Form onSubmit={handleSubmit} noValidate>
          <FloatingInput
            label="Name *"
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
            maxLength={100}
          />
          <FloatingInput
            label="Email *"
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            maxLength={100}
          />
          <FloatingInput
            label="Phone"
            type="tel"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
            maxLength={20}
          />
          <FloatingInput
            label="Resume Link"
            type="url"
            name="resumeLink"
            value={formData.resumeLink}
            onChange={handleChange}
            placeholder="https://example.com/resume.pdf"
          />
          <Button
            type="submit"
            variant="primary"
            className="w-100"
            disabled={loading}
            aria-label="Add Student"
          >
            {loading ? (
              <>
                <span
                  className="spinner-border spinner-border-sm me-2"
                  role="status"
                  aria-hidden="true"
                />
                Adding...
              </>
            ) : (
              <>
                <PlusCircle className="me-2" />
                Add Student
              </>
            )}
          </Button>
        </Form>
      </Card.Body>
    </Card>
  );
});

/* Excel Upload */
const ExcelUpload = React.memo(({ onExcelUploaded }) => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState(null);

  const handleFileSelect = useCallback((e) => {
    const file = e.target.files[0];
    if (
      file &&
      (file.type ===
        'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet') ||
      file.type === 'application/vnd.ms-excel'
    ) {
      setSelectedFile(file);
      setUploadResult(null);
    } else {
      setSelectedFile(null);
      alert('Please select a valid Excel file (.xlsx or .xls)');
    }
  }, []);

  const handleUpload = async () => {
    if (!selectedFile) {
      alert('Please select a file first');
      return;
    }
    setUploading(true);
    try {
      const result = await studentService.uploadExcel(selectedFile);
      setUploadResult(result.summary);
      onExcelUploaded(result.summary);
      setSelectedFile(null);
      document.getElementById('excel-upload').value = '';
      toast.success('Excel uploaded and processed successfully');
    } catch (error) {
      console.error('Upload error:', error);
      alert('Failed to upload Excel file');
    } finally {
      setUploading(false);
    }
  };

  const downloadSample = async () => {
    try {
      const blob = await studentService.downloadSampleExcel();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = 'student-template.xlsx';
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
    } catch (error) {
      console.error('Download error:', error);
      alert('Failed to download sample template');
    }
  };

  return (
    <Card className="shadow-sm rounded">
      <Card.Header className="bg-success text-white d-flex align-items-center">
        <PlusCircle size={24} className="me-2" />
        <h5 className="mb-0">Bulk Upload Students</h5>
      </Card.Header>
      <Card.Body>
        <Form>
          <Form.Floating>
            <Form.Control
              id="excel-upload"
              type="file"
              accept=".xlsx,.xls"
              onChange={handleFileSelect}
              disabled={uploading}
              placeholder="Select Excel file"
              aria-label="Select Excel file"
            />
            <Form.Label>Select Excel File</Form.Label>
          </Form.Floating>
          <Form.Text className="text-muted mb-3 d-block">
            Supported formats: .xlsx, .xls
          </Form.Text>
          <Row className="g-2">
            <Col xs={12} sm={6}>
              <Button
                variant="success"
                className="w-100"
                onClick={handleUpload}
                disabled={!selectedFile || uploading}
                aria-label="Upload Excel"
              >
                {uploading ? (
                  <>
                    <span
                      className="spinner-border spinner-border-sm me-2"
                      role="status"
                      aria-hidden="true"
                    />
                    Uploading...
                  </>
                ) : (
                  'Upload Excel'
                )}
              </Button>
            </Col>
            <Col xs={12} sm={6}>
              <Button
                variant="outline-secondary"
                className="w-100"
                onClick={downloadSample}
                disabled={uploading}
                aria-label="Download Sample Template"
              >
                Download Sample Template
              </Button>
            </Col>
          </Row>
          {uploading && (
            <div className="mt-3">
              <ProgressBar animated now={100} variant="success" />
            </div>
          )}
        </Form>
        {uploadResult && (
          <Alert
            variant={uploadResult.failed > 0 ? 'warning' : 'success'}
            className="mt-3"
            dismissible
            onClose={() => setUploadResult(null)}
          >
            <Alert.Heading>Upload Results</Alert.Heading>
            <p className="mb-2">
              Total Records: {uploadResult.total}
              <br />
              Successfully Added: {uploadResult.successful}
              <br />
              Failed: {uploadResult.failed}
            </p>
            {uploadResult.errors?.length > 0 && (
              <div>
                <strong>Errors:</strong>
                <ul className="mt-2 mb-0 small">
                  {uploadResult.errors.slice(0, 5).map((error, idx) => (
                    <li key={idx}>
                      Row {error.row}: {error.error}
                    </li>
                  ))}
                  {uploadResult.errors.length > 5 && (
                    <li>... and {uploadResult.errors.length - 5} more errors</li>
                  )}
                </ul>
              </div>
            )}
          </Alert>
        )}
      </Card.Body>
    </Card>
  );
});

/* Slot Creator */
const SlotCreator = React.memo(({ onSlotCreated }) => {
  const [selectedDate, setSelectedDate] = useState(() => new Date());
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    try {
      await slotService.createSlot({ slotDateTime: selectedDate });
      setSelectedDate(new Date());
      onSlotCreated();
      toast.success('Interview slot created successfully');
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to create slot');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Card className="shadow-sm rounded">
      <Card.Header className="bg-success text-white d-flex align-items-center">
        <CalendarPlus size={24} className="me-2" />
        <h5 className="mb-0">Create Interview Slot</h5>
      </Card.Header>
      <Card.Body>
        {error && (
          <Alert variant="danger" onClose={() => setError('')} dismissible>
            {error}
          </Alert>
        )}
        <Form onSubmit={handleSubmit} noValidate>
          <Form.Group className="mb-3">
            <Form.Label className="fw-semibold">Select Date & Time</Form.Label>
            <DatePicker
              selected={selectedDate}
              onChange={(date) => setSelectedDate(date || new Date())}
              showTimeSelect
              dateFormat="MMMM d, yyyy h:mm aa"
              minDate={new Date()}
              className="form-control rounded"
              placeholderText="Select date and time"
              autoComplete="off"
            />
            <Form.Text className="text-muted">
              Select a future date and time for the interview slot
            </Form.Text>
          </Form.Group>
          <Button
            type="submit"
            variant="success"
            className="w-100"
            disabled={loading}
            aria-label="Create Slot"
          >
            {loading ? (
              <>
                <span
                  className="spinner-border spinner-border-sm me-2"
                  role="status"
                  aria-hidden="true"
                />
                Creating...
              </>
            ) : (
              <>
                <PlusCircle className="me-2" />
                Create Slot
              </>
            )}
          </Button>
        </Form>
      </Card.Body>
    </Card>
  );
});

/* Interview List */
const InterviewList = React.memo(({ interviews: initialInterviews }) => {
  const [interviews, setInterviews] = useState(initialInterviews || []);
  const [showModal, setShowModal] = useState(false);
  const [selectedInterview, setSelectedInterview] = useState(null);
  const [newStatus, setNewStatus] = useState('');

  useEffect(() => {
    if (initialInterviews) setInterviews(initialInterviews);
  }, [initialInterviews]);

  const getStatusVariant = (status) => {
    return {
      Invited: 'info',
      Scheduled: 'primary',
      Completed: 'success',
      Cancelled: 'danger',
      'No-Show': 'warning',
    }[status] || 'secondary';
  };

  const handleStatusUpdate = (interview) => {
    setSelectedInterview(interview);
    setNewStatus(interview.Status);
    setShowModal(true);
  };

  const submitStatusUpdate = async () => {
    if (!selectedInterview) return;
    try {
      await interviewService.updateStatus(selectedInterview.Id, newStatus);
      setInterviews((prev) =>
        prev.map((i) => (i.Id === selectedInterview.Id ? { ...i, Status: newStatus } : i))
      );
      toast.success('Interview status updated successfully');
      setShowModal(false);
    } catch (error) {
      toast.error('Failed to update interview status');
    }
  };

  return (
    <>
      <div className="d-flex justify-content-between align-items-center mb-3">
        <h5 className="d-flex align-items-center mb-0 text-primary">
          <CalendarCheck className="me-2" />
          Scheduled Interviews
        </h5>
        <Badge bg="info" pill>
          {interviews.length} Total
        </Badge>
      </div>
      <div className="table-responsive shadow-sm rounded">
        <Table striped bordered hover responsive className="mb-0">
          <thead className="table-primary">
            <tr>
              <th>Student</th>
              <th>Email</th>
              <th>Slot Date & Time</th>
              <th>Interviewer</th>
              <th>Status</th>
              <th>Meeting Link</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {interviews.length === 0 ? (
              <tr>
                <td colSpan="7" className="text-center text-muted py-3">
                  No interviews scheduled yet
                </td>
              </tr>
            ) : (
              interviews.map((interview) => (
                <tr key={interview.Id}>
                  <td>{interview.StudentName}</td>
                  <td>{interview.StudentEmail}</td>
                  <td>
                    {interview.SlotDateTime
                      ? new Date(interview.SlotDateTime).toLocaleString()
                      : '-'}
                  </td>
                  <td>{interview.Interviewer || '-'}</td>
                  <td>
                    <Badge bg={getStatusVariant(interview.Status)}>{interview.Status}</Badge>
                  </td>
                  <td>
                    {interview.MeetingLink ? (
                      <Button
                        size="sm"
                        variant="outline-primary"
                        href={interview.MeetingLink}
                        target="_blank"
                        rel="noopener noreferrer"
                        aria-label={`Join Meeting for ${interview.StudentName}`}
                      >
                        <CameraVideo className="me-1" /> Join
                      </Button>
                    ) : (
                      '-'
                    )}
                  </td>
                  <td>
                    <Button
                      size="sm"
                      variant="outline-secondary"
                      onClick={() => handleStatusUpdate(interview)}
                      className="me-2"
                      aria-label={`Update Interview Status for ${interview.StudentName}`}
                    >
                      <Pencil className="me-1" /> Update
                    </Button>
                    <Button
                      size="sm"
                      variant="outline-danger"
                      onClick={async () => {
                        if (
                          window.confirm('Are you sure you want to delete this interview?')
                        ) {
                          try {
                            await interviewService.deleteInterview(interview.Id);
                            setInterviews((prev) =>
                              prev.filter((i) => i.Id !== interview.Id)
                            );
                            toast.success('Interview deleted');
                          } catch {
                            toast.error('Failed to delete interview');
                          }
                        }
                      }}
                      aria-label={`Delete Interview for ${interview.StudentName}`}
                    >
                      <Trash />
                    </Button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </Table>
      </div>

      {/* Status Update Modal */}
      <Modal show={showModal} onHide={() => setShowModal(false)} centered>
        <Modal.Header closeButton>
          <Modal.Title>Update Interview Status</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Floating>
              <Form.Select
                id="statusSelect"
                value={newStatus}
                onChange={(e) => setNewStatus(e.target.value)}
                aria-label="Select interview status"
              >
                <option value="Invited">Invited</option>
                <option value="Scheduled">Scheduled</option>
                <option value="Completed">Completed</option>
                <option value="Cancelled">Cancelled</option>
                <option value="No-Show">No-Show</option>
              </Form.Select>
              <Form.Label htmlFor="statusSelect">Interview Status</Form.Label>
            </Form.Floating>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={() => setShowModal(false)}>
            Cancel
          </Button>
          <Button variant="primary" onClick={submitStatusUpdate}>
            Update Status
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
});

/* Main AdminDashboard */
const AdminDashboard = () => {
  const [students, setStudents] = useState([]);
  const [slots, setSlots] = useState([]);
  const [interviews, setInterviews] = useState([]);
  const [selectedStudents, setSelectedStudents] = useState([]);

  const loadData = useCallback(async () => {
    try {
      const [studentsData, slotsData, interviewsData] = await Promise.all([
        studentService.getStudents(),
        slotService.getSlots(),
        interviewService.getInterviews(),
      ]);
      setStudents(studentsData);
      setSlots(slotsData);
      setInterviews(interviewsData);
    } catch (error) {
      toast.error('Failed to load data');
      console.error('Load data error:', error);
    }
  }, []);

  useEffect(() => {
    loadData();
  }, [loadData]);

  const handleStudentAdded = useCallback(() => {
    loadData();
  }, [loadData]);

  const handleExcelUploaded = useCallback(
    (result) => {
      loadData();
      toast.success(
        `Excel processed: ${result.successful} successful, ${result.failed} failed`
      );
    },
    [loadData]
  );

  const handleSlotCreated = useCallback(() => {
    loadData();
  }, [loadData]);

  const handleSendInvitations = async () => {
    if (selectedStudents.length === 0) {
      toast.warning('Please select students to send invitations');
      return;
    }
    try {
      await studentService.sendInvitations(selectedStudents);
      toast.success('Invitations sent successfully');
      setSelectedStudents([]);
    } catch (error) {
      toast.error('Failed to send invitations');
      console.error('Invitation error:', error);
    }
  };

  const handleSelectAllStudents = (checked) => {
    if (checked) {
      setSelectedStudents(students.map((s) => s.Id));
    } else {
      setSelectedStudents([]);
    }
  };

  return (
    <Container fluid className="py-4">
      <Row className="mb-4">
        <Col xs={12}>
          <h2 className="text-primary fw-bold">Interview Scheduler - Admin Dashboard</h2>
        </Col>
      </Row>

      <Tabs
        defaultActiveKey="students"
        className="mb-4 shadow-sm rounded"
        fill
        justify
        id="admin-dashboard-tabs"
      >
        <Tab eventKey="students" title="Student Management" tabClassName="fs-6 fw-semibold">
          <Row className="g-4">
            <Col xs={12} md={6}>
              <StudentForm onStudentAdded={handleStudentAdded} />
            </Col>
            <Col xs={12} md={6}>
              <ExcelUpload onExcelUploaded={handleExcelUploaded} />
            </Col>
          </Row>

          <Row className="mt-5">
            <Col xs={12}>
              <Card className="shadow-sm rounded">
                <Card.Header className="d-flex justify-content-between align-items-center bg-info text-white">
                  <h5 className="mb-0">Students List</h5>
                  <Button
                    variant="light"
                    className="fw-semibold"
                    onClick={handleSendInvitations}
                    disabled={selectedStudents.length === 0}
                    aria-label="Send Invitations"
                  >
                    Send Invitations ({selectedStudents.length})
                  </Button>
                </Card.Header>
                <Card.Body className="p-0">
                  <div className="table-responsive">
                    <Table striped hover responsive className="mb-0">
                      <thead className="table-info align-middle">
                        <tr>
                          <th style={{ width: '3rem' }}>
                            <Form.Check
                              type="checkbox"
                              id="selectAllStudents"
                              onChange={(e) =>
                                handleSelectAllStudents(e.target.checked)
                              }
                              checked={
                                selectedStudents.length > 0 &&
                                selectedStudents.length === students.length
                              }
                              aria-label="Select all students"
                            />
                          </th>
                          <th>Name</th>
                          <th>Email</th>
                          <th>Phone</th>
                          <th>Resume</th>
                          <th style={{ width: '100px' }}>Actions</th>
                        </tr>
                      </thead>
                      <tbody>
                        {students.length === 0 ? (
                          <tr>
                            <td colSpan={6} className="text-center py-4 text-muted">
                              No students found
                            </td>
                          </tr>
                        ) : (
                          students.map((student) => (
                            <tr key={student.Id}>
                              <td>
                                <Form.Check
                                  type="checkbox"
                                  id={`student-${student.Id}`}
                                  checked={selectedStudents.includes(student.Id)}
                                  onChange={(e) => {
                                    if (e.target.checked) {
                                      setSelectedStudents((prev) => [
                                        ...prev,
                                        student.Id,
                                      ]);
                                    } else {
                                      setSelectedStudents((prev) =>
                                        prev.filter((id) => id !== student.Id)
                                      );
                                    }
                                  }}
                                  aria-label={`Select student ${student.Name}`}
                                />
                              </td>
                              <td>{student.Name}</td>
                              <td>{student.Email}</td>
                              <td>{student.Phone || '-'}</td>
                              <td>
                                {student.ResumeLink ? (
                                  <a
                                    href={student.ResumeLink}
                                    target="_blank"
                                    rel="noopener noreferrer"
                                    className="text-decoration-none"
                                    aria-label={`View resume of ${student.Name}`}
                                  >
                                    View Resume
                                  </a>
                                ) : (
                                  '-'
                                )}
                              </td>
                              <td>
                                <Button
                                  variant="danger"
                                  size="sm"
                                  onClick={async () => {
                                    if (
                                      window.confirm(
                                        'Are you sure you want to delete this student?'
                                      )
                                    ) {
                                      try {
                                        await studentService.deleteStudent(student.Id);
                                        toast.success('Student deleted successfully');
                                        loadData();
                                      } catch (error) {
                                        const backendError =
                                          error.response?.data?.error;
                                        toast.error(
                                          backendError || 'Failed to delete student'
                                        );
                                      }
                                    }
                                  }}
                                  aria-label={`Delete student ${student.Name}`}
                                >
                                  <Trash />
                                </Button>
                              </td>
                            </tr>
                          ))
                        )}
                      </tbody>
                    </Table>
                  </div>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </Tab>

        <Tab eventKey="slots" title="Interview Slots" tabClassName="fs-6 fw-semibold">
          <Row className="g-4">
            <Col xs={12} md={4}>
              <SlotCreator onSlotCreated={handleSlotCreated} />
            </Col>
            <Col xs={12} md={8}>
              <Card className="shadow-sm rounded">
                <Card.Header className="bg-success text-white">
                  <h5 className="mb-0">Available Slots</h5>
                </Card.Header>
                <Card.Body className="p-0">
                  <div className="table-responsive">
                    <Table striped hover responsive className="mb-0">
                      <thead className="table-success align-middle">
                        <tr>
                          <th>Date & Time</th>
                          <th>Status</th>
                          <th>Booked By</th>
                          <th style={{ width: '100px' }}>Actions</th>
                        </tr>
                      </thead>
                      <tbody>
                        {slots.length === 0 ? (
                          <tr>
                            <td colSpan={4} className="text-center py-4 text-muted">
                              No slots available
                            </td>
                          </tr>
                        ) : (
                          slots.map((slot) => (
                            <tr key={slot.Id}>
                              <td>{new Date(slot.SlotDateTime).toLocaleString()}</td>
                              <td>
                                <Badge
                                  bg={slot.IsBooked ? 'danger' : 'success'}
                                  className="py-1"
                                >
                                  {slot.IsBooked ? 'Booked' : 'Available'}
                                </Badge>
                              </td>
                              <td>{slot.IsBooked ? slot.StudentName : '-'}</td>
                              <td>
                                <Button
                                  variant="danger"
                                  size="sm"
                                  onClick={async () => {
                                    if (
                                      window.confirm('Are you sure you want to delete this slot?')
                                    ) {
                                      try {
                                        await slotService.deleteSlot(slot.Id);
                                        toast.success('Slot deleted');
                                        loadData();
                                      } catch {
                                        toast.error('Failed to delete slot');
                                      }
                                    }
                                  }}
                                  aria-label={`Delete slot on ${new Date(
                                    slot.SlotDateTime
                                  ).toLocaleString()}`}
                                >
                                  <Trash />
                                </Button>
                              </td>
                            </tr>
                          ))
                        )}
                      </tbody>
                    </Table>
                  </div>
                </Card.Body>
              </Card>
            </Col>
          </Row>
        </Tab>

        <Tab
          eventKey="interviews"
          title="Scheduled Interviews"
          tabClassName="fs-6 fw-semibold"
        >
          <InterviewList interviews={interviews} />
        </Tab>
      </Tabs>
    </Container>
  );
};

export default AdminDashboard;
